            var geoJsonLayer = L.geoJson({"type": "FeatureCollection", "features": [{"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.42499, 49.33473]}, "properties": {"time": "2044-06-06T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-06-06<br> Bernieres-sur-Mer</b></h1><h2>D-Day Landing</h2>", "tooltip": "<h1>44-06-06<br> Bernieres-sur-Mer</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.39223, 49.26532]}, "properties": {"time": "2044-06-07T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-06-07<br> Anguerny</b></h1><h2>D-Day Objective met. Spent a few days consolidating location</h2>", "tooltip": "<h1>44-06-07<br> Anguerny</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.41778, 49.23052]}, "properties": {"time": "2044-06-10T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-06-10<br> Bray</b></h1><h2>Assigned to 7th Bgd due to their heavy casualties</h2>", "tooltip": "<h1>44-06-10<br> Bray</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.4839, 49.23341]}, "properties": {"time": "2044-06-11T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-06-11<br> Neuf Mer</b></h1><h2>D coy attacked at Norrey-en-Besin. 54 Killed, 37 wounded, 11 captured attempting to take Le Mesnil-Patry. 6 QOR executed by 12 SS Panzers</h2>", "tooltip": "<h1>44-06-11<br> Neuf Mer</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.48913, 49.22878]}, "properties": {"time": "2044-06-13T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-06-13<br> Bray</b></h1><h2>Rest and Recovery day. Apparantly A coys booby traps and trip wire work very well for two cows and a horse have just been killed by them. All the local cooks immediately dash out for a supply of fresh meat and are quite successful.</h2>", "tooltip": "<h1>44-06-13<br> Bray</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.51564, 49.21193]}, "properties": {"time": "2044-06-18T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-06-18<br> Bretteville</b></h1><h2>In close contact with the enemy. Night Patrols conducted. 62 replacements received.</h2>", "tooltip": "<h1>44-06-18<br> Bretteville</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.44985, 49.23874]}, "properties": {"time": "2044-06-28T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-06-28<br> Cairon</b></h1><h2>Bath parade. Total casualties to date Killed 113, Wounded 131, Missing 26.</h2>", "tooltip": "<h1>44-06-28<br> Cairon</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.45127, 49.23961]}, "properties": {"time": "2123-06-30T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>23-06-30<br> Cairon</b></h1><h2>Attack on Gruchy by SD&G Highlanders called off QOR were to support the cction.</h2>", "tooltip": "<h1>23-06-30<br> Cairon</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.49316, 49.17919]}, "properties": {"time": "2044-07-04T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-07-04<br> Marcelet</b></h1><h2>Move up in prepartion of attack at Carpiquet Airport.  North Shore Reqt and Regt de la Chaudiere, and Royal Winnipeg Rifles start the attack. At 1100 QOR move into postion but attack postponed as RWR are forced from their position. QOR has enemy on 3 sides, but hold their position.</h2>", "tooltip": "<h1>44-07-04<br> Marcelet</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.45518, 49.18732]}, "properties": {"time": "2044-07-05T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-07-05<br> Carpiquet</b></h1><h2>Mortar and Shell fire continues. No major incidents.</h2>", "tooltip": "<h1>44-07-05<br> Carpiquet</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.46828, 49.1762]}, "properties": {"time": "2044-07-06T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-07-06<br> Carpiquet</b></h1><h2>B Coy releives RWR. 7th and 9th Bdg prepare for attack  on Caen. Heavy bomber attack softens Caen.</h2>", "tooltip": "<h1>44-07-06<br> Carpiquet</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.44732, 49.16951]}, "properties": {"time": "2044-07-09T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-07-09<br> Carpiquet</b></h1><h2>After a day's  postponement, C and C Coy attack, with little resistance. Airport control bldg taken by 1030.</h2>", "tooltip": "<h1>44-07-09<br> Carpiquet</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.43955, 49.1778]}, "properties": {"time": "2044-07-10T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-07-10<br> Carpiquet Airport Control Building</b></h1><h2>Quiet, but on 1 hour notice to move. Patrols nearLouvigny discover considerable enemy action.</h2>", "tooltip": "<h1>44-07-10<br> Carpiquet Airport Control Building</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.38318, 49.22594]}, "properties": {"time": "2044-07-13T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-07-13<br> Galmanche</b></h1><h2>Rest Area. Not attractive, bldgs demolished, many dead Germans and animals around.  Bath Parade. Thomas Easton promoted to LCpl 15 Jul.</h2>", "tooltip": "<h1>44-07-13<br> Galmanche</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.28793, 49.21736]}, "properties": {"time": "2044-07-17T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-07-17<br> eastof Caen</b></h1><h2>Form up East of Caen for Op Atlantic Attack. Objective to capture Vaucelles.</h2>", "tooltip": "<h1>44-07-17<br> eastof Caen</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.27776, 49.20679]}, "properties": {"time": "2044-07-18T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-07-18<br> Sainte-Honorine la Chardronette</b></h1><h2>At 0700 hrs, 18 July, the attack started, with B Sqn 1st Hussars providing Armour. Advance closely following the artillery barrage, steady progress was made. </h2>", "tooltip": "<h1>44-07-18<br> Sainte-Honorine la Chardronette</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.28186, 49.1806]}, "properties": {"time": "2044-07-19T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-07-19<br> GiberVille</b></h1><h2>Battle summary:  28 Killed, 68 wounded more than 600 prisoners taken.</h2>", "tooltip": "<h1>44-07-19<br> GiberVille</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.28567, 49.14902]}, "properties": {"time": "2044-07-22T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-07-22<br> Grentheville</b></h1><h2>Heavy shelling. Preparations for attack on Roquancourt and Garcelles Secqueville.</h2>", "tooltip": "<h1>44-07-22<br> Grentheville</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.29945, 49.12441]}, "properties": {"time": "2044-07-27T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-07-27<br> Bourgebus</b></h1><h2>Operation Spring began 25 Jul. QOR replaced the North Shore Regiment in Bourgebus Ridge, a key postion for the closing of the Falaise Gap. 3rd Div replaced by 4th Armoured Div. QOR replaced by Lincoln and Welland Regiment.</h2>", "tooltip": "<h1>44-07-27<br> Bourgebus</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.44649, 49.27662]}, "properties": {"time": "2044-08-01T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-08-01<br> Fontaine Henry</b></h1><h2>Rest camp out of artillery range. After 56 days in contact with the Germans, the QOR are finally out of enemy contact. Total casualties to date, 169 killed, 295 wounded, 39 Battle exhaustion.  Troops went for a swim at Bernieres-sur-mer, returing to the site where they first landed. Thomas Easton promoted to ACpl on 02 Aug. Only5 of the original 20 Rifle Coy Sgts remained with the regiment.</h2>", "tooltip": "<h1>44-08-01<br> Fontaine Henry</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.3450143, 49.1819008]}, "properties": {"time": "2044-08-09T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-08-09<br> Cormelles</b></h1><h2>Moving into position for OperationTotalize</h2>", "tooltip": "<h1>44-08-09<br> Cormelles</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.26652, 49.01989]}, "properties": {"time": "2044-08-10T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-08-10<br> Langannerie</b></h1><h2>QOR moved forward under Arty fire, but encountered hidden tanks. Polish tanks that were to support them were bombed by the US with heavy losses, so there was no tank support.  QOR withdrew, suffering 22 killed, and 68 wounded. </h2>", "tooltip": "<h1>44-08-10<br> Langannerie</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.26129, 49.0245]}, "properties": {"time": "2044-08-12T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-08-12<br> Bretteville le Rabet</b></h1><h2>Replaced RWR. Expected counter-attack did not materialize. Adm order for Operation Tallulah.  Polish Armour replaced QOR.</h2>", "tooltip": "<h1>44-08-12<br> Bretteville le Rabet</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.2592948, 49.0340059]}, "properties": {"time": "2044-08-14T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-08-14<br> Robertmesnil</b></h1><h2>1200 moved to start line at Sognelles in Kangaroo APCs. 1400 Bombers came over and dropped bombs on friendly troops. Objective of Maizieres reached by 1800. Casualties light, 400 prisoners taken.</h2>", "tooltip": "<h1>44-08-14<br> Robertmesnil</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.15876, 48.99889]}, "properties": {"time": "2044-08-15T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-08-15<br> Maizures</b></h1><h2>Spent several days improving positions.</h2>", "tooltip": "<h1>44-08-15<br> Maizures</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [-0.1423722, 48.9601589]}, "properties": {"time": "2044-08-18T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-08-18<br> Damblainville</b></h1><h2>An amusing incident happened this afternoon.\u00a0 Rfn\u00a0W Meharg and\u00a0Rfn\u00a0\"Bud\" Edward were on\u00a0their way to this area with petrol. They took the wrong road and wound up in enemy lines. Five\u00a0Jerries\u00a0came out and paid them 4500 francs to take them prisoners</h2>", "tooltip": "<h1>44-08-18<br> Damblainville</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [0.03095, 48.9183]}, "properties": {"time": "2044-08-20T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-08-20<br> GrandMesnil</b></h1><h2>Moving forward.</h2>", "tooltip": "<h1>44-08-20<br> GrandMesnil</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [0.06224, 48.92072]}, "properties": {"time": "2044-08-21T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-08-21<br> Hill 230</b></h1><h2>Advance without opposition.</h2>", "tooltip": "<h1>44-08-21<br> Hill 230</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [0.47367, 49.23312]}, "properties": {"time": "2044-08-24T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-08-24<br> Orbec</b></h1><h2>Advanced 23 miles in one day</h2>", "tooltip": "<h1>44-08-24<br> Orbec</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [0.83403, 49.35172]}, "properties": {"time": "2044-08-25T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-08-25<br> Bourg-Achard</b></h1><h2>Clearing woods from remaining enemy.</h2>", "tooltip": "<h1>44-08-25<br> Bourg-Achard</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [0.8332682, 49.2785857]}, "properties": {"time": "2044-08-27T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-08-27<br> Le Thuit</b></h1><h2>Advanced 68 miles in 3 days with very little resistance.</h2>", "tooltip": "<h1>44-08-27<br> Le Thuit</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.005049, 49.294835]}, "properties": {"time": "2044-08-30T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-08-30<br> Elbeuf</b></h1><h2>Crossed the Seine. No opposition encountered.</h2>", "tooltip": "<h1>44-08-30<br> Elbeuf</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.4282438, 49.7420124]}, "properties": {"time": "2044-08-31T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-08-31<br> Neuf Chatel</b></h1><h2>All along route civilians handed out flowers and every vehicle has at least one bouquet on it. An impressive sight was seen en-route</h2>", "tooltip": "<h1>44-08-31<br> Neuf Chatel</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.51637, 50.06085]}, "properties": {"time": "2044-09-01T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-01<br> Meneslies</b></h1><h2>Moving north to attack the channel ports as part of OP Tallulah</h2>", "tooltip": "<h1>44-09-01<br> Meneslies</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.706, 50.73315]}, "properties": {"time": "2094-09-05T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>94-09-05<br> Montreuil-sur-Mer; la Capelle</b></h1><h2>Advancing towards Boulogne, set up camp 5 miles east of Boulogne. Shower parade amidst intermittent shelling. Organizing for the attack</h2>", "tooltip": "<h1>94-09-05<br> Montreuil-sur-Mer; la Capelle</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.74637, 50.744]}, "properties": {"time": "2044-09-13T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-13<br> Wierre Effroy</b></h1><h2>HQ set up at Chateau.</h2>", "tooltip": "<h1>44-09-13<br> Wierre Effroy</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.706, 50.73315]}, "properties": {"time": "2044-09-14T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-14<br> Montreuil-sur-Mer; la Capelle</b></h1><h2>Battle preparation. Artillery and Typhoon attacks on Boulogne and Mt Lambert</h2>", "tooltip": "<h1>44-09-14<br> Montreuil-sur-Mer; la Capelle</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.6815487, 50.738471]}, "properties": {"time": "2044-09-17T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-17<br> BOIS de SOUVRAIN MOULI</b></h1><h2>Move to Start line.  200 Bombers attack defences. </h2>", "tooltip": "<h1>44-09-17<br> BOIS de SOUVRAIN MOULI</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.66794314836458, 50.7408767891626]}, "properties": {"time": "2044-09-17T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-17<br> L'Ermitage</b></h1><h2>The coys started to move to the assembly area in the BOIS de SOUVRAIN MOULIN, arriving there at 0830 hrs. The bn start line extended from OLINGTHUN to la CORETTE. Our axis of advance was along the road running from L\u2019Ermitage through la MAUTE CLUSE to WECANDENNE.</h2>", "tooltip": "<h1>44-09-17<br> L'Ermitage</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.642336, 50.733571]}, "properties": {"time": "2044-09-17T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-17<br> Wicardenne</b></h1><h2>0955 Bn crossed the start line with \u201cB\u201d and \u201cD\u201d Coys as the forward coys. \u201cB\u201d Coy advanced to their first objective the village of WICANDENNE. Capt Sawyer \u201cB\u201d Coy Commander was wounded slightly in the should but was still carrying on. He was standing talking to a tank commander in a mine field at 704545 when a group of Jerry prisoners came in and a Jerry Sgt stepped off the path that had been cleared by the flails exploding a mine which killed both Capt Sawyer and the Jerry Sgt.</h2>", "tooltip": "<h1>44-09-17<br> Wicardenne</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.61842, 50.72866]}, "properties": {"time": "2044-09-17T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-17<br> St Martin de Boulogne</b></h1><h2>\u201cC\u201d Coy passed through \u201cB\u201d Coy and advanced to their objective at MARLBOTOUCH.\n\u201cD\u201d Coy advanced to take control of the main cross roads at 687541.\n</h2>", "tooltip": "<h1>44-09-17<br> St Martin de Boulogne</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.63079, 50.73201]}, "properties": {"time": "2044-09-17T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-17<br> St Martin de Boulogne</b></h1><h2>\u201cB\u201d Coy advanced to take the cross roads at 696544. The capture of these two main road junctions completely sewed up an possible chance of the enemy trying to get out of BOULOGNE.</h2>", "tooltip": "<h1>44-09-17<br> St Martin de Boulogne</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.6262304, 50.7229159]}, "properties": {"time": "2044-09-17T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-17<br> St Martin de Boulogne</b></h1><h2>Advance  by company. LSgt Thomas Easton Killed 17 Sep.</h2>", "tooltip": "<h1>44-09-17<br> St Martin de Boulogne</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.61078, 50.73278]}, "properties": {"time": "2044-09-18T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-18<br> Maison des Lycens Mariette</b></h1><h2>Advance continues. Heavy resistance encountered. 100 prisoners taken. Temporary burial site of QOR including Thomas.</h2>", "tooltip": "<h1>44-09-18<br> Maison des Lycens Mariette</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.61811, 50.74218]}, "properties": {"time": "2044-09-21T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-21<br> Napoleans Monument</b></h1><h2>\u201cC\u201d Coy advanced and took out enemy strong point around NAPOLEON\u2019S MONUMENT at 688556.</h2>", "tooltip": "<h1>44-09-21<br> Napoleans Monument</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.60078, 50.73317]}, "properties": {"time": "2044-09-21T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-21<br> Boulogne</b></h1><h2>\u201cA\u201d and \u201cB\u201d Coys attacked strong enemy gun positions in the area around the pillbox at 675547, and after some stiff fighting cleared the area of the enemy, also clearing out the pillbox a the same time.</h2>", "tooltip": "<h1>44-09-21<br> Boulogne</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.5962685, 50.7487403]}, "properties": {"time": "2044-09-22T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-22<br> Fort de la Creche</b></h1><h2>Fort was German strong hold. 78 bombers attacked, but it took 2 days before Germans surrendered. 500 prisoners taken. 18 QOR killed, 60 wounded. A total 8500 Germans taken prisoner by all units. \u201cC\u201d and \u201cD\u201d Coys \u2013 made assault on Fort-de-la-Creche. This wasn\u2019t one of our original objectives, but our neighbouring battalions were having difficulty with it and it had to be cleaned up. Major Neil Gordon, \u201cC\u201d Coy Commander, who was wounded in the charge of \u201cThe Modern Light Brigade\u201d on June 11th and who returned to the unit from England just before the Boulogne show, fired a Jerry 50mm Ack Ack gun at the Fort and the Jerries started coming out with their hands up. There is only one major point of resistance left in the BOULOGNE area and this is the Fort at le PORTEL which is South East of the city.</h2>", "tooltip": "<h1>44-09-22<br> Fort de la Creche</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.8435414, 50.8562407]}, "properties": {"time": "2044-09-23T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-23<br> HERVELINGHEN</b></h1><h2>0730 Crossed the start line at 687542 and followed main BOULOGNE \u2013 CALAIS road through MARQUISE,turned left at ST INGLEVERT and proceeded North West to HERVELINGHEN.</h2>", "tooltip": "<h1>44-09-23<br> HERVELINGHEN</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.692784, 50.89299]}, "properties": {"time": "2044-09-24T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-24<br> Somber</b></h1><h2>\u201cA\u201d Coy patrol reports no enemy in either ESCALLES or HAUTE ESCALLES. Flares fired from area of observatory at 778751. <br> Heavy bombers of RAF (Lancasters) attacked Cap-Gris-Nez. This bombing lasted for two hours and from what could be seen from our positions the defenses there took quite a pounding.\n1800 Medium bombers over area again although visibility was poor.</h2>", "tooltip": "<h1>44-09-24<br> Somber</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [1.79676, 50.76931]}, "properties": {"time": "2044-09-27T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-27<br> Le Mensil</b></h1><h2>20 enemy deserters from Cap-Gris-Nez walked into \u201cA\u201d Coy kitchen to give themselves up. They claimed yesterday\u2019s bombing hadn\u2019t done an awful lot of damage except to morale, but thought another bombing would soften the defences up a lot.\n0900 Coys left present positions for march to Mesnil where we are presumably going for a rest.\n1400 Coys arrive at MESNIL and move into allotted areas.\n1500 Bn HQ left present positions at 757722 for MESNIL.\n1600 Bn HQ arrived at MESNIL and Bn HQ set up at farm at 816576.</h2>", "tooltip": "<h1>44-09-27<br> Le Mensil</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [2.02477, 50.99156]}, "properties": {"time": "2044-09-28T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-09-28<br> Gravelines</b></h1><h2>1630 Arrived in new area. Bn HQ set up at 016800. Coys moved into defensive positions at \u201cA\u201d Coy, 995810, \u201cB\u201d Coy 989789, \u201cC\u201d Coy 008805, \u201cD\u201d Coy 015790 and A/Tk Plt at 986794.</h2>", "tooltip": "<h1>44-09-28<br> Gravelines</h1>", "style": {"icon": "circle", "iconSize": [8, 8], "color": "blue"}}}, {"type": "Feature", "geometry": {"type": "Point", "coordinates": [2.05568, 50.98402]}, "properties": {"time": "2044-10-01T00:00:00", "popup": "<h1 style=\"text-align:center;\"><b>44-10-01<br> Calais</b></h1><h2>Rear BHQ moved up to forward BHQ at chateau at 916765 le Beau-Marais.\n0930 \u201cA\u201d Coy moved forward from Forst Vert to the town of COURGAIN, meeting no enemy opposition.\n1110 \u201cA\u201d Coy moved forward
